script: |
  super -f text -I q5192.spq | sort > q5192.out

inputs:
  - name: q5192.spq
    data: |
      SELECT DISTINCT + col0 * - 69 + col2 AS col1 FROM tab2 (FORMAT parquet) WHERE NOT NULL BETWEEN + 71 * - + col0 + - 11 * - ( col2 ) * + ( + - col1 ) AND - + col2;
  - name: tab2

outputs:
  - name: q5192.out
    data: |
